jobs_results.description:
Contract duration: 6 months, with the possibility of extension.
Start date: January 2025.
Language: English.
Location: No restrictions (remote work possible)
Experience Level: Senior

Requirements
• Bachelor’s degree in Computer Science, IT, or related field (or equivalent experience);
• Minimum of 5 years of experience in Android development;
• Proficiency in Kotlin and Jetpack Compose;
• Strong understanding of Android SDK, different versions of Android, and screen size adaptability;
• Experience integrating Android applications with RESTful APIs;
• Knowledge of Android architecture components (e.g., MVVM, MVP) and scalable application design;
• Proficiency in writing and maintaining unit tests;
• Familiarity with cloud messaging APIs and push notifications;
• Experience with offline storage, threading, and performance tuning;
• Proficient in Git and other version control tools;
• Bonus: iOS development experience

Responsibilities
• Design, develop, and maintain Android applications using Kotlin and Jetpack Compose;
• Collaborate with cross-functional teams to define and ship new features;
• Ensure the performance, quality, and responsiveness of applications;
• Identify and resolve bottlenecks, bugs, and other development challenges;
• Stay updated with new technologies to maximize development efficiency;
• Write clean and maintainable code;
• Conduct code reviews and mentor junior developers;
• Adhere to Google’s Android design principles and interface guidelines.

Additional Information:
• Applicants must specify their hourly rate (excluding VAT) in their financial proposal.
• The proposal should include:
• Hourly rate
• Availability to start
• Relevant certifications and experience

How to Apply:

Send your updated CV and financial proposal to alinz@partnerd.ro. Ensure that your submission includes the requested rate and details.

Application Deadline: ASAP.

Join a dynamic project where your expertise will contribute to the success of a key mobile app project. Apply now and let’s build something great together!
